const Header = () => {
    return(
        <>
        <div className="header">
            <div className="top-strip">
                <div className="container">
                    <p className="mb-0 mt-0 text-center">Devido a epidemia de <b>COVID 19</b>, nossas entregas podem demorar mais que o normal</p>
                </div>
            </div>
        </div>
        </>
    )
}

export default Header;
